# The GFLASH radial equation is
# 
# $$
# f(x) = 2p\frac{rR_C^2}{(r^2 + R_C^2)^2} + 2(1-p)\frac{rR_T^2}{(r^2 + R_T^2)^2}
# $$
# 
# The exponential radial equation is
# 
# $$
# f(x) = p.\frac{\mathrm{exp}(-r/R_c)}{R_c^2} + (1-p)\frac{\mathrm{exp}
# $$
